import React, { useState } from 'react';
import axios from 'axios';
import { Container, Button, Form, Card, ProgressBar } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const Chatbot = () => {
  const [answers, setAnswers] = useState({});
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [response, setResponse] = useState('');

  const questions = [
    {
      question: 'How are you feeling today overall?',
      options: [
        'Very Happy ðŸ˜Š',
        'Somewhat Happy ðŸ™‚',
        'Neutral ðŸ˜',
        'Somewhat Sad ðŸ˜•',
        'Very Sad ðŸ˜¢'
      ]
    },
    {
      question: 'How many hours did you sleep last night?',
      options: [
        'Less than 4 hours ðŸ˜´',
        '4-6 hours ðŸ›ï¸',
        '6-8 hours ðŸ’¤',
        '8-10 hours ðŸ˜Œ',
        'More than 10 hours ðŸŒ™'
      ]
    },
    {
      question: 'How would you rate your stress level?',
      options: [
        'No stress at all ðŸ˜Œ',
        'Mild stress ðŸ˜…',
        'Moderate stress ðŸ˜“',
        'High stress ðŸ˜–',
        'Severe stress ðŸ˜£'
      ]
    },
    {
      question: 'How is your energy level today?',
      options: [
        'Very energetic âš¡',
        'Somewhat energetic ðŸŒŸ',
        'Normal ðŸŒž',
        'Somewhat tired ðŸŒ¥ï¸',
        'Very tired ðŸ’¤'
      ]
    },
    {
      question: 'How would you describe your appetite today?',
      options: [
        'Very good appetite ðŸ½ï¸',
        'Normal appetite ðŸ´',
        'Somewhat reduced ðŸ¥„',
        'Poor appetite ðŸ˜•',
        'No appetite at all ðŸ˜£'
      ]
    },
    {
      question: 'How well can you concentrate today?',
      options: [
        'Excellent focus ðŸŽ¯',
        'Good focus ðŸ‘€',
        'Moderate focus ðŸ¤”',
        'Poor focus ðŸ˜µ',
        'Cannot concentrate ðŸ˜«'
      ]
    },
    {
      question: 'How social have you been lately?',
      options: [
        'Very social ðŸ‘¥',
        'Moderately social ðŸ—£ï¸',
        'Sometimes social ðŸ’­',
        'Rarely social ðŸ¤',
        'Not social at all ðŸ˜¶'
      ]
    },
    {
      question: 'How satisfied are you with your daily activities?',
      options: [
        'Very satisfied ðŸŒŸ',
        'Somewhat satisfied ðŸ˜Š',
        'Neutral ðŸ˜',
        'Somewhat dissatisfied ðŸ˜•',
        'Very dissatisfied ðŸ˜ž'
      ]
    }
  ];

  const handleAnswer = (answer) => {
    setAnswers({ ...answers, [currentQuestion]: answer });
    if (currentQuestion < questions.length - 1) {
      setCurrentQuestion(currentQuestion + 1);
    }
  };

  const handleSubmit = async () => {
    try {
      const { data } = await axios.post(
        'http://localhost:5000/api/chatbot/generate-response',
        { answers: Object.values(answers) },
        { withCredentials: true }
      );
      setResponse(data.reply);
      setCurrentQuestion(0);
      setAnswers({});
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const handleBack = () => {
    if (currentQuestion > 0) {
      setCurrentQuestion(currentQuestion - 1);
    }
  };


  const progress = ((currentQuestion + 1) / questions.length) * 100;

  return (
    <Container className="d-flex justify-content-center align-items-center min-vh-100 py-5">
      <Card style={{ width: '40rem', padding: '20px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)' }}>
        <h2 className="text-center mb-4">Mental Health Assessment</h2>
        <ProgressBar now={progress} className="mb-4" variant="info" label={`${Math.round(progress)}%`} />
        
        {currentQuestion < questions.length ? (
          <>
            <Form.Group className="mb-4">
              <Form.Label className="fw-bold">{questions[currentQuestion].question}</Form.Label>
              {questions[currentQuestion].options.map((option, index) => (
                <Button
                  key={index}
                  variant={answers[currentQuestion] === option ? "primary" : "outline-primary"}
                  className="w-100 mb-2 text-start"
                  onClick={() => handleAnswer(option)}
                >
                  {option}
                </Button>
              ))}
            </Form.Group>
            
            {Object.keys(answers).length === questions.length && (
              <Button 
                variant="success" 
                onClick={handleSubmit} 
                className="w-100 mt-3"
              >
                Submit Assessment
              </Button>
            )}
          </>
        ) : null}

        {response && (
          <Card className="mt-4 p-3" style={{ backgroundColor: '#f8f9fa' }}>
            <Card.Body>
              <Card.Title>Assessment Results</Card.Title>
              <Card.Text>{response}</Card.Text>
            </Card.Body>
          </Card>
        )}
      </Card>
    </Container>
  );
};

export default Chatbot;
